import React from 'react'
import './userlist.css'

function UserLisr({user, deleteUser}) {
  return (
    <div className='userList'>
        <div className="userList-container container">
            {user.map((value)=> {
                return(
                    <div className="card">
                        <div className="card-inner">
                            <img src={value.image} alt="value.firstname" height={150} width={150} />
                            <h3>{value.firstName} {value.lastName}, {value.age} age</h3>
                            <p>From: {value.from}</p>
                            <p>Job: {value.job}</p>
                            <p>Gender: {value.gender}</p>
                            <button onClick={()=>deleteUser(value.id)}>Delete</button>
                        </div>
                    </div>
                )
            })}
        </div>
    </div>
  )
}

export default UserLisr
